import './App.css';
import NavBar from './componets/NavBar';
import React from 'react';
import {BrowserRouter as Router, Switch, Route} from "react-router-dom"

function App() {
  return (
   <>
   <Router>
    <NavBar/>
    <Switch>
      <Route path="/"/>
    </Switch>
   </Router>

   </>


  );
}

export default App;
